import{_ as n}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as s,c as a,e}from"./app.d7b34baa.js";const p={},t=e('<h1 id="mysql从入门到入院" tabindex="-1"><a class="header-anchor" href="#mysql从入门到入院" aria-hidden="true">#</a> MySQL从入门到入院</h1><p>MySQL是一个关系型数据库，其实本质上就是一款软件、一个程序：</p><ul><li>这个程序中管理着多个数据库；</li><li>每个数据库中可以有多张表；</li><li>每个表中可以有多条数据；</li></ul><h2 id="认识sql语句" tabindex="-1"><a class="header-anchor" href="#认识sql语句" aria-hidden="true">#</a> 认识SQL语句</h2><p>我们希望操作数据库（特别是在程序中），就需要有和数据库沟通的语言，这个语言就是SQL：</p><ul><li>SQL是Structured Query Language，称之为结构化查询语言，简称SQL；</li><li>使用SQL编写出来的语句，就称之为SQL语句；</li><li>SQL语句可以用于对数据库进行操作；</li></ul><p>事实上，常见的关系型数据库SQL语句都是比较相似的，所以你学会了MySQL中的SQL语句，之后去操作比如 Oracle或者其他关系型数据库，也是非常方便的。</p><p><strong>SQL语句的常用规范：</strong></p><ul><li>通常关键字是大写的，比如CREATE、TABLE、SHOW等等；</li><li>一条语句结束后，需要以 ; 结尾；</li><li>如果遇到关键字作为表明或者字段名称，可以使用``包裹;</li></ul><h2 id="sql语句的分类" tabindex="-1"><a class="header-anchor" href="#sql语句的分类" aria-hidden="true">#</a> SQL语句的分类</h2><p><strong>常见的SQL语句我们可以分成四类：</strong></p><p>DDL（Data Definition Language）：数据定义语言；</p><ul><li>可以通过DDL语句对数据库或者表进行：创建、删除、修改等操作；</li></ul><p>DML（Data Manipulation Language）：数据操作语言；</p><ul><li>可以通过DML语句对表进行：添加、删除、修改等操作；</li></ul><p>DQL（Data Query Language）：数据查询语言；</p><ul><li>可以通过DQL从数据库中查询记录；（重点）</li></ul><p>DCL（Data Control Language）：数据控制语言；</p><p>对数据库、表格的权限进行相关访问控制操作；</p><h2 id="数据库的操作" tabindex="-1"><a class="header-anchor" href="#数据库的操作" aria-hidden="true">#</a> 数据库的操作</h2><p><strong>查看当前数据库</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 查看所有的数据</span>\n<span class="token keyword">SHOW</span> <span class="token keyword">DATABASES</span><span class="token punctuation">;</span>\n<span class="token comment"># 使用某一个数据</span>\n<span class="token keyword">USE</span> coderhub<span class="token punctuation">;</span>\n<span class="token comment"># 查看当前正在使用的数据库</span>\n<span class="token keyword">SELECT</span> <span class="token keyword">DATABASE</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>创建新的数据库</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 创建数据库语句</span>\n<span class="token keyword">CREATE</span> <span class="token keyword">DATABASE</span> bilibili<span class="token punctuation">;</span>\n<span class="token keyword">CREATE</span> <span class="token keyword">DATABASE</span> <span class="token keyword">IF</span> <span class="token operator">NOT</span> <span class="token keyword">EXISTS</span> bilibili<span class="token punctuation">;</span>\n<span class="token keyword">CREATE</span> <span class="token keyword">DATABASE</span> <span class="token keyword">IF</span> <span class="token operator">NOT</span> <span class="token keyword">EXISTS</span> bilibili\n<span class="token keyword">DEFAULT</span> <span class="token keyword">CHARACTER</span> <span class="token keyword">SET</span> utf8mb4 <span class="token keyword">COLLATE</span> utf8mb4_0900_ai_ci<span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>**删除数据库 **</p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 删除数据库</span>\n<span class="token keyword">DROP</span> <span class="token keyword">DATABASE</span> bilibili<span class="token punctuation">;</span>\n<span class="token keyword">DROP</span> <span class="token keyword">DATABASE</span> <span class="token keyword">IF</span> <span class="token keyword">EXIT</span> bilibili<span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>修改数据库</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 修改数据库的字符集和排序规则</span>\n<span class="token keyword">ALTER</span> <span class="token keyword">DATABASE</span> bilibili <span class="token keyword">CHARACTER</span> <span class="token keyword">SET</span> <span class="token operator">=</span> utf8 <span class="token keyword">COLLATE</span> <span class="token operator">=</span> utf8_unicode_ci<span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>**查看数据表 **</p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 查看所有的数据表</span>\n<span class="token keyword">SHOW</span> <span class="token keyword">TABLES</span><span class="token punctuation">;</span>\n<span class="token comment"># 查看某一个表结构</span>\n<span class="token keyword">DESC</span> <span class="token keyword">user</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>**创建数据表 **</p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">CREATE</span> <span class="token keyword">TABLE</span> <span class="token keyword">IF</span> <span class="token operator">NOT</span> <span class="token keyword">EXISTS</span> <span class="token identifier"><span class="token punctuation">`</span>users<span class="token punctuation">`</span></span><span class="token punctuation">(</span>\n	name <span class="token keyword">VARCHAR</span><span class="token punctuation">(</span><span class="token number">20</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n	age <span class="token keyword">INT</span><span class="token punctuation">,</span>\n	height <span class="token keyword">DOUBLE</span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>创建一个完整的表</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 创建一张表</span>\n<span class="token keyword">CREATE</span> <span class="token keyword">TABLE</span> <span class="token keyword">IF</span> <span class="token operator">NOT</span> <span class="token keyword">EXISTS</span> <span class="token identifier"><span class="token punctuation">`</span>users<span class="token punctuation">`</span></span><span class="token punctuation">(</span>\n	id <span class="token keyword">INT</span> <span class="token keyword">PRIMARY</span> <span class="token keyword">KEY</span> <span class="token keyword">AUTO_INCREMENT</span><span class="token punctuation">,</span>\n	name <span class="token keyword">VARCHAR</span><span class="token punctuation">(</span><span class="token number">20</span><span class="token punctuation">)</span> <span class="token operator">NOT</span> <span class="token boolean">NULL</span><span class="token punctuation">,</span>\n	age <span class="token keyword">INT</span> <span class="token keyword">DEFAULT</span> <span class="token number">0</span><span class="token punctuation">,</span>\n	telPhone <span class="token keyword">VARCHAR</span><span class="token punctuation">(</span><span class="token number">20</span><span class="token punctuation">)</span> <span class="token keyword">DEFAULT</span> <span class="token string">&#39;&#39;</span> <span class="token keyword">UNIQUE</span> <span class="token operator">NOT</span> <span class="token boolean">NULL</span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>删除数据表</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 删除数据库</span>\n<span class="token keyword">DROP</span> <span class="token keyword">TABLE</span> users<span class="token punctuation">;</span>\n<span class="token keyword">DROP</span> <span class="token keyword">TABLE</span> <span class="token keyword">IF</span> <span class="token keyword">EXISTS</span> users<span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>修改表</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 1.修改表名</span>\n<span class="token keyword">ALTER</span> <span class="token keyword">TABLE</span> <span class="token identifier"><span class="token punctuation">`</span>moments<span class="token punctuation">`</span></span> <span class="token keyword">RENAME</span> <span class="token keyword">TO</span> <span class="token identifier"><span class="token punctuation">`</span>moment<span class="token punctuation">`</span></span><span class="token punctuation">;</span>\n<span class="token comment"># 2.添加一个新的列</span>\n<span class="token keyword">ALTER</span> <span class="token keyword">TABLE</span> <span class="token identifier"><span class="token punctuation">`</span>moment<span class="token punctuation">`</span></span> <span class="token keyword">ADD</span> <span class="token identifier"><span class="token punctuation">`</span>publishTime<span class="token punctuation">`</span></span> <span class="token keyword">DATETIME</span><span class="token punctuation">;</span>\n<span class="token keyword">ALTER</span> <span class="token keyword">TABLE</span> <span class="token identifier"><span class="token punctuation">`</span>moment<span class="token punctuation">`</span></span> <span class="token keyword">ADD</span> <span class="token identifier"><span class="token punctuation">`</span>updateTime<span class="token punctuation">`</span></span> <span class="token keyword">DATETIME</span><span class="token punctuation">;</span>\n<span class="token comment"># 3.删除一列数据</span>\n<span class="token keyword">ALTER</span> <span class="token keyword">TABLE</span> <span class="token identifier"><span class="token punctuation">`</span>moment<span class="token punctuation">`</span></span> <span class="token keyword">DROP</span> <span class="token identifier"><span class="token punctuation">`</span>updateTime<span class="token punctuation">`</span></span><span class="token punctuation">;</span>\n<span class="token comment"># 4.修改列的名称</span>\n<span class="token keyword">ALTER</span> <span class="token keyword">TABLE</span> <span class="token identifier"><span class="token punctuation">`</span>moment<span class="token punctuation">`</span></span> CHANGE <span class="token identifier"><span class="token punctuation">`</span>publishTime<span class="token punctuation">`</span></span> <span class="token identifier"><span class="token punctuation">`</span>publishDate<span class="token punctuation">`</span></span> <span class="token keyword">DATE</span><span class="token punctuation">;</span>\n<span class="token comment"># 5.修改列的数据类型</span>\n<span class="token keyword">ALTER</span> <span class="token keyword">TABLE</span> <span class="token identifier"><span class="token punctuation">`</span>moment<span class="token punctuation">`</span></span> <span class="token keyword">MODIFY</span> <span class="token identifier"><span class="token punctuation">`</span>id<span class="token punctuation">`</span></span> <span class="token keyword">INT</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>插入数据</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">INSERT</span> <span class="token keyword">INTO</span> <span class="token identifier"><span class="token punctuation">`</span>products<span class="token punctuation">`</span></span> <span class="token punctuation">(</span><span class="token identifier"><span class="token punctuation">`</span>title<span class="token punctuation">`</span></span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>description<span class="token punctuation">`</span></span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>price<span class="token punctuation">`</span></span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>publishTime<span class="token punctuation">`</span></span><span class="token punctuation">)</span> <span class="token keyword">VALUES</span> <span class="token punctuation">(</span><span class="token string">&#39;iPhone&#39;</span><span class="token punctuation">,</span> <span class="token string">&#39;iPhone12只要998&#39;</span><span class="token punctuation">,</span> <span class="token number">998.88</span><span class="token punctuation">,</span> <span class="token string">&#39;2020-10-10&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span> \n<span class="token keyword">INSERT</span> <span class="token keyword">INTO</span> <span class="token identifier"><span class="token punctuation">`</span>products<span class="token punctuation">`</span></span> <span class="token punctuation">(</span><span class="token identifier"><span class="token punctuation">`</span>title<span class="token punctuation">`</span></span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>description<span class="token punctuation">`</span></span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>price<span class="token punctuation">`</span></span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>publishTime<span class="token punctuation">`</span></span><span class="token punctuation">)</span> <span class="token keyword">VALUES</span> <span class="token punctuation">(</span><span class="token string">&#39;huawei&#39;</span><span class="token punctuation">,</span> <span class="token string">&#39;iPhoneP40只要888&#39;</span><span class="token punctuation">,</span> <span class="token number">888.88</span><span class="token punctuation">,</span> <span class="token string">&#39;2020-11-11&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>删除数据</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 删除数据</span>\n<span class="token comment"># 会删除表中所有的数据</span>\n<span class="token keyword">DELETE</span> <span class="token keyword">FROM</span> <span class="token identifier"><span class="token punctuation">`</span>products<span class="token punctuation">`</span></span><span class="token punctuation">;</span>\n<span class="token comment"># 会删除符合条件的数据</span>\n<span class="token keyword">DELETE</span> <span class="token keyword">FROM</span> <span class="token identifier"><span class="token punctuation">`</span>products<span class="token punctuation">`</span></span> <span class="token keyword">WHERE</span> <span class="token identifier"><span class="token punctuation">`</span>title<span class="token punctuation">`</span></span> <span class="token operator">=</span> <span class="token string">&#39;iPhone&#39;</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>修改数据</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token comment"># 修改数据</span>\n<span class="token comment"># 会修改表中所有的数据</span>\n<span class="token keyword">UPDATE</span> <span class="token identifier"><span class="token punctuation">`</span>products<span class="token punctuation">`</span></span> <span class="token keyword">SET</span> <span class="token identifier"><span class="token punctuation">`</span>title<span class="token punctuation">`</span></span> <span class="token operator">=</span> <span class="token string">&#39;iPhone12&#39;</span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>price<span class="token punctuation">`</span></span> <span class="token operator">=</span> <span class="token number">1299.88</span><span class="token punctuation">;</span>\n<span class="token comment"># 会修改符合条件的数据</span>\n<span class="token keyword">UPDATE</span> <span class="token identifier"><span class="token punctuation">`</span>products<span class="token punctuation">`</span></span> <span class="token keyword">SET</span> <span class="token identifier"><span class="token punctuation">`</span>title<span class="token punctuation">`</span></span> <span class="token operator">=</span> <span class="token string">&#39;iPhone12&#39;</span><span class="token punctuation">,</span> <span class="token identifier"><span class="token punctuation">`</span>price<span class="token punctuation">`</span></span> <span class="token operator">=</span> <span class="token number">1299.88</span> <span class="token keyword">WHERE</span> <span class="token identifier"><span class="token punctuation">`</span>title<span class="token punctuation">`</span></span> <span class="token operator">=</span> <span class="token string">&#39;iPhone&#39;</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>如果我们希望修改完数据后，直接可以显示最新的更新时间</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">ALTER</span> <span class="token keyword">TABLE</span> <span class="token identifier"><span class="token punctuation">`</span>products<span class="token punctuation">`</span></span> <span class="token keyword">ADD</span> <span class="token identifier"><span class="token punctuation">`</span>updateTime<span class="token punctuation">`</span></span> <span class="token keyword">TIMESTAMP</span> <span class="token keyword">DEFAULT</span> <span class="token keyword">CURRENT_TIMESTAMP</span> <span class="token keyword">ON</span> <span class="token keyword">UPDATE</span> <span class="token keyword">CURRENT_TIMESTAMP</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h2 id="sql的数据类型" tabindex="-1"><a class="header-anchor" href="#sql的数据类型" aria-hidden="true">#</a> SQL的数据类型</h2><p>我们知道不同的数据会划分为不同的数据类型，在数据库中也是一样，MySQL支持的数据类型有：数字类型，日期和时间类型，字符串（字符和字节）类型，空间类型和 JSON数 据类型。</p><h3 id="数字类型" tabindex="-1"><a class="header-anchor" href="#数字类型" aria-hidden="true">#</a> 数字类型</h3><ul><li>整数数字类型：INTEGER，INT，SMALLINT，TINYINT，MEDIUMINT，BIGINT；</li></ul><p><img src="https://mc-web-1259409954.cos.ap-guangzhou.myqcloud.com/MyImages/202204112000481.png" alt="image-20220411200045385"></p><ul><li>浮点数字类型：FLOAT，DOUBLE（FLOAT是4个字节，DOUBLE是8个字节）；</li><li>精确数字类型：DECIMAL，NUMERIC（DECIMAL是NUMERIC的实现形式）；</li></ul><h3 id="日期类型" tabindex="-1"><a class="header-anchor" href="#日期类型" aria-hidden="true">#</a> 日期类型</h3><p>YEAR以YYYY格式显示值</p><ul><li>范围 1901到2155，和 0000</li></ul><p>DATE类型用于具有日期部分但没有时间部分的值</p><ul><li>DATE以格式YYYY-MM-DD显示值 ；</li><li>支持的范围是 &#39;1000-01-01&#39; 到 &#39;9999-12-31&#39;；</li></ul><p>DATETIME类型用于包含日期和时间部分的值：</p><ul><li>DATETIME以格式&#39;YYYY-MM-DD hh:mm:ss&#39;显示值；</li><li>支持的范围是1000-01-01 00:00:00到9999-12-31 23:59:59;</li></ul><p>TIMESTAMP数据类型被用于同时包含日期和时间部分的值：</p><ul><li>TIMESTAMP以格式&#39;YYYY-MM-DD hh:mm:ss&#39;显示值；</li><li>但是它的范围是UTC的时间范围：&#39;1970-01-01 00:00:01&#39;到&#39;2038-01-19 03:14:07&#39;;</li></ul><blockquote><p>DATETIME或TIMESTAMP 值可以包括在高达微秒（6位）精度的后小数秒一部分</p><p>比如DATETIME表示的范围可以是&#39;1000-01-01 00:00:00.000000&#39;到&#39;9999-12-31 23:59:59.999999&#39;;</p></blockquote><h3 id="字符串类型" tabindex="-1"><a class="header-anchor" href="#字符串类型" aria-hidden="true">#</a> 字符串类型</h3><p>CHAR类型在创建表时为固定长度，长度可以是0到255之间的任何值；</p><ul><li>在被查询时，会删除后面的空格；</li></ul><p>VARCHAR类型的值是可变长度的字符串，长度可以指定为0到65535之间的值；</p><ul><li>VARCHAR类型的值是可变长度的字符串，长度可以指定为0到65535之间的值；</li></ul><p>BLOB用于存储大的二进制类型；</p><p>TEXT用于存储大的字符串类型；</p><h2 id="表约束" tabindex="-1"><a class="header-anchor" href="#表约束" aria-hidden="true">#</a> 表约束</h2><p><strong>主键：PRIMARY KEY</strong></p><p><strong>唯一：UNIQUE</strong></p><p><strong>不能为空：NOT NULL</strong></p><p><strong>默认值：DEFAULT</strong></p><p><strong>自动递增：AUTO_INCREMENT</strong></p><h2 id="dql语句" tabindex="-1"><a class="header-anchor" href="#dql语句" aria-hidden="true">#</a> DQL语句</h2><p><strong>查询的格式如下：</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">SELECT</span> select_expr <span class="token punctuation">[</span><span class="token punctuation">,</span> select_expr<span class="token punctuation">]</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span>\n	<span class="token punctuation">[</span><span class="token keyword">FROM</span> table_references<span class="token punctuation">]</span>\n	<span class="token punctuation">[</span><span class="token keyword">WHERE</span> where_condition<span class="token punctuation">]</span>\n	<span class="token punctuation">[</span><span class="token keyword">ORDER</span> <span class="token keyword">BY</span> expr <span class="token punctuation">[</span><span class="token keyword">ASC</span> <span class="token operator">|</span> <span class="token keyword">DESC</span><span class="token punctuation">]</span><span class="token punctuation">]</span>\n	<span class="token punctuation">[</span><span class="token keyword">LIMIT</span> {<span class="token punctuation">[</span><span class="token keyword">offset</span><span class="token punctuation">,</span><span class="token punctuation">]</span> row_count <span class="token operator">|</span> row_count <span class="token keyword">OFFSET</span> <span class="token keyword">offset</span>}<span class="token punctuation">]</span>\n	<span class="token punctuation">[</span><span class="token keyword">GROUP</span> <span class="token keyword">BY</span> expr<span class="token punctuation">]</span>\n	<span class="token punctuation">[</span><span class="token keyword">HAVING</span> where_condition<span class="token punctuation">]</span>\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div>',78),o=[t];function l(c,i){return s(),a("div",null,o)}const k=n(p,[["render",l],["__file","MySQL从入门到入院.html.vue"]]);export{k as default};
